import React, { useState } from "react";
import "./List.css";
import Header from "./Header";
import Space from "./Space";
import arrow from "../assets/arrow.svg";
import arrow_down from "../assets/arrow_down.svg";
import userplus from "../assets/userplus.svg";
import arrow_right from "../assets/arrow_right.svg";
import done from "../assets/done.svg";
import listadd from "../assets/listadd.svg";
import details_arrow from "../assets/details_arrow.svg";
import compare from "../assets/compare.svg";
import add_ from "../assets/add_.svg";
import checkmark_circle from "../assets/checkmark_circle.svg";
import arrow_dropdown from "../assets/arrow_dropdown.svg";
import sortdown from "../assets/sortdown.png";
import exit from "../assets/exit.png";
import menuvertical from "../assets/menuvertical.png";
import like from "../assets/like.svg";
import attach from "../assets/attach.png";
import avatar from "../assets/avatar.jpg";
import {
    Popover,
    Menu,
    Dialog,
    TextInputField,
    TextInput,
    SelectMenu,
    Position,
    Table,
    MoreIcon,
    Pane,
    DragHandleVerticalIcon,
} from "evergreen-ui";

import avatar1 from "../assets/avatar1.jpeg";
import avatar2 from "../assets/avatar2.jpeg";

function List() {
    const [selected, setSelected] = React.useState(null);
    const [isShown, setIsShown] = React.useState(false);
    const [isShown1, setIsShown1] = React.useState(false);
    const [writeTask, setWriteTask] = React.useState(false);
    const [writeTask1, setWriteTask1] = React.useState(false);
    const [writeTask2, setWriteTask2] = React.useState(false);
    const [contentOpen, setContentOpen] = React.useState(true);
    const [editableField, setEditableField] = React.useState(false);
    const [editableField1, setEditableField1] = React.useState(false);
    const [editableField2, setEditableField2] = React.useState(false);
    const [contentOpen1, setContentOpen1] = React.useState(true);
    const [contentOpen2, setContentOpen2] = React.useState(true);

    const [title, setTitle] = React.useState(false);

    const editable_body = {
        fontFamily: "GTEestiProDisplay-light",
        fontSize: "12px",
        color: "#444444",
    };
    const coll_drpdwn = {
        height: "35px",
        paddingBottom: "15px",
    };

    const disabled = {
        marginTop: "-10px",
        marginLeft: "-18px",
        marginRight: "-10px",
    };
    const textinput = {
        height: "40px",
        border: "solid 0.1px #cecece",
        color: "#9a9a9a",
    };

    const invite = {
        height: "20px",
    };
    const table_padding = {
        padding: 0,
        paddingLeft: "10px",
    };
    const table_padding_ = {
        padding: "3px",
    };
    const menu = {
        height: "23px",
        marginLeft: "-18px",
    };
    function handleKeyDown(e) {
        if (e.key === "Enter") {
            setEditableField(false);
        }
    }
    function handleKeyDown1(e) {
        if (e.key === "Enter") {
            setEditableField1(false);
        }
    }
    function handleKeyDown2(e) {
        if (e.key === "Enter") {
            setEditableField2(false);
        }
    }

    function openNav() {
        document.getElementById("mySidenav").style.width = "683px";
    }
    function closeNav() {
        document.getElementById("mySidenav").style.width = "0";
    }
    return (
        <div>
            <Header />
            <Space />
            <div className="map">
                <h2>List</h2>
                <div className="map_head">
                    <Dialog
                        margin="none"
                        padding="none"
                        topOffset={170}
                        width={465}
                        minHeightContent={305}
                        onCloseComplete={() => setIsShown1(false)}
                        preventBodyScrolling
                        hasHeader={false}
                        isShown={isShown1}
                        hasFooter={false}
                    >
                        <div className="share_workspace">
                            <h4>Add your teammates to deski Software</h4>
                            <p>
                                People you add will receive an invite automatically or after your site admin has approved
                                the request.
                            </p>
                            <TextInputField
                                width={400}
                                style={textinput}
                                className="share_input"
                                placeholder="Type name, group or email address"
                            />
                            <SelectMenu
                                height={140}
                                width={400}
                                title="Select name"
                                options={["Collaborator", "Admin", "Viewer", "Administrator"].map((label) => ({
                                    label,
                                    value: label,
                                }))}
                                selected={selected}
                                closeOnSelect={true}
                                hasFilter={false}
                                hasTitle={false}
                                onSelect={(item) => setSelected(item.value)}
                            >
                                <button className="dropdown">
                                    {selected || "Administrator"}
                                    <img src={arrow} className="drop_icon" alt="" height="8" width="15" />
                                </button>
                            </SelectMenu>

                            <div>
                                <button className="cancel_btn" onClick={() => setIsShown(false)}>
                                    Cancel
                                </button>
                                <button className="add_btn" onClick={() => setIsShown(false)} s>
                                    Add
                                </button>
                            </div>
                        </div>
                    </Dialog>
                    <Dialog
                        margin="none"
                        padding="none"
                        topOffset={170}
                        width={465}
                        minHeightContent={305}
                        onCloseComplete={() => setIsShown(false)}
                        preventBodyScrolling
                        hasHeader={false}
                        isShown={isShown}
                        hasFooter={false}
                    >
                        <div className="share_workspace">
                            <h4>Add your teammates to deski Software</h4>
                            <p>
                                People you add will receive an invite automatically or after your site admin has approved
                                the request.
                            </p>
                            <TextInputField
                                width={400}
                                style={textinput}
                                className="share_input"
                                placeholder="Type name, group or email address"
                            />
                            <SelectMenu
                                height={140}
                                width={400}
                                title="Select name"
                                options={["Collaborator", "Admin", "Viewer", "Administrator"].map((label) => ({
                                    label,
                                    value: label,
                                }))}
                                selected={selected}
                                closeOnSelect={true}
                                hasFilter={false}
                                hasTitle={false}
                                onSelect={(item) => setSelected(item.value)}
                            >
                                <button className="dropdown">
                                    {selected || "Administrator"}
                                    <img src={arrow} className="drop_icon" alt="" height="8" width="15" />
                                </button>
                            </SelectMenu>

                            <div>
                                <button className="cancel_btn" onClick={() => setIsShown(false)}>
                                    Cancel
                                </button>
                                <button className="add_btn" onClick={() => setIsShown(false)} s>
                                    Add
                                </button>
                            </div>
                        </div>
                    </Dialog>

                    <Popover
                        minWidth={210}
                        marginTop={400}
                        position={Position.BOTTOM_LEFT}
                        content={
                            <Menu>
                                <Menu.Group>
                                    <Menu.Item className="disabled_" disabled>
                                        <p className="disabled_">Your collaborator</p>
                                    </Menu.Item>
                                    <Menu.Item
                                        style={coll_drpdwn}
                                        className="coll_drpdwn"
                                        icon={<img src={avatar} alt="" className="bd_profiles" height="25" width="23" />}
                                    >
                                        <p>Abdu Rahiman</p>
                                    </Menu.Item>
                                    <Menu.Item
                                        style={coll_drpdwn}
                                        className="coll_drpdwn"
                                        icon={<img src={avatar1} alt="" className="bd_profiles" height="25" width="23" />}
                                    >
                                        <p>Abdu Rahiman</p>
                                    </Menu.Item>
                                    <Menu.Item
                                        style={coll_drpdwn}
                                        className="coll_drpdwn"
                                        icon={<img src={avatar} alt="" className="bd_profiles" height="25" width="23" />}
                                    >
                                        <p>Abdu Rahiman</p>
                                    </Menu.Item>
                                    <Menu.Item
                                        style={coll_drpdwn}
                                        className="coll_drpdwn"
                                        icon={<img src={avatar1} alt="" className="bd_profiles" height="25" width="23" />}
                                    >
                                        <p>Abdu Rahiman</p>
                                    </Menu.Item>
                                    <Menu.Item
                                        style={coll_drpdwn}
                                        className="coll_drpdwn"
                                        icon={<img src={avatar} alt="" className="bd_profiles" height="25" width="23" />}
                                    >
